import { Injectable } from '@angular/core';

import { Videojuegos, listaDummy } from '../models/videojuegos';

@Injectable({
  providedIn: 'root'
})
export class DataService {

  constructor() { }

  getGamesLista(): Videojuegos[] {
    return listaDummy;
  }
}
